import styled from 'styled-components';

export default styled.ul`
  	width: 100%;
	list-style-type: none;
	display: flex;
	flex-flow: row-wrap;
  	justify-content: ${props => {
	  		switch(props.justify) {
	  			case props.right:
	  				console.log('right');
	  				return 'flex-end';
	  			case props.left:
	  				console.log('right');
	  				return 'flex-start';
	  			case props.center:
	  				console.log('center');
	  				return 'space-around';  				
	  			default:
	  				console.log('default');
	  		}
  		}}
`;
